// https://stackoverflow.com/questions/17242144/javascript-convert-hsb-hsv-color-to-rgb-accurately
function HSVtoRGB(h, s, v) {
    var r, g, b, i, f, p, q, t;
    if (arguments.length === 1) {
        s = h.s, v = h.v, h = h.h;
    }
    i = Math.floor(h * 6);
    f = h * 6 - i;
    p = v * (1 - s);
    q = v * (1 - f * s);
    t = v * (1 - (1 - f) * s);
    switch (i % 6) {
        case 0: r = v, g = t, b = p; break;
        case 1: r = q, g = v, b = p; break;
        case 2: r = p, g = v, b = t; break;
        case 3: r = p, g = q, b = v; break;
        case 4: r = t, g = p, b = v; break;
        case 5: r = v, g = p, b = q; break;
    }
    return 'rgb('+Math.round(r * 255)+','+Math.round(g * 255)+','+Math.round(b * 255)+')';
    return {
        r: Math.round(r * 255),
        g: Math.round(g * 255),
        b: Math.round(b * 255)
    };
}

    function drawPoly(coords,colorIndex) {
      var poly = new google.maps.Polygon({
        map: map,
        paths: coords,
        //strokeColor: HSVtoRGB(colors[colorIndex],1,0.7),

        strokeOpacity: 0.5,
        strokeWeight: 3,
        //fillColor: HSVtoRGB(colors[colorIndex],1,1),
        fillColor: HSVtoRGB(getColorHue(colorIndex),1*getColorSat(colorIndex),getColorValue(colorIndex)),
        fillOpacity: 0.3,
        visible: true,
        draggable: false,
        clickable: false,
        editable: false,
        geodesic: false,
        zIndex: 200000,
      });
      polys.push(poly);
      return poly;
    }

    var added = splitArray.added;
    var removed = splitArray.removed;
    var splitArray = null;
    var allTheRects = {};  // a map of Rectangle with their 'index' (e.g. 12_0_0 or 15_1_3) as the key
    var rectToRemove = null;
    var justAddedRects = [];
    var skippingMode = false;
    var z = 1;

    function resetSubs(loop, delay) {
      //document.getElementById('loop').innerHTML = '<i>another</i>';
      document.getElementById('loop').value = ''+(loop+1);
      // first, set all new rects to regular blue
      for (var kid=0;kid<justAddedRects.length;kid++) {
        justAddedRects[kid].setOptions({
          fillOpacity: 0.1,
          //strokeOpacity: 0.4,
          strokeOpacity: 0.4,
          strokeWeight: 2,
          zIndex: z++,
        });
      }
      justAddedRects = [];  // blank the list
      // then, the last one that was split (now white) needs to be removed
      if (rectToRemove != null) {
        rectToRemove.setMap(null);        
      }
      // ok, more to go?
      if (loop >= added.length) return;
      //if (loop >= 21) return;  // debugging
      if (skippingMode) {  // at the beginning, skipping guys
        // look ahead one loop
        var addedCount = 0;
        if (loop+1 < added.length) {
          for (var i=0;i<added[loop+1].length;i++) {
            addedCount += added[loop+1][i].length;
          }
          if (addedCount == 1) {
            console.log("skipping loop "+loop+", wait until we run into a bigger split");
            setTimeout(resetSubs,0,loop+1,delay);  // skip this guy, don't change the delay, and don't wait
            return;
          }
        }
        skippingMode = false;  // turn it off, start here
      }
      var splitGuy = removed[loop];  // will be an array, somthing like [12,1,0]
      var index = splitGuy.join("_");
      var rect = allTheRects[index];
      if (rect != null) {
        rect.setOptions({
          strokeColor: '#FFffff',
          strokeOpacity: 1.0,
          strokeWeight: 4,
          //fillOpacity: 0.5,
          fillOpacity: 0.2,
          // fillColor: '#FF5555',
          zIndex: z++,
        });
        rectToRemove = rect;
      }
      setTimeout(drawSubs,delay,loop,delay);
    }

    function drawSubs(loop,delay) {
      var rect = allTheRects[removed[loop].join('_')];
      if (rect != null) {
        rect.setOptions({
          fillOpacity: 0,
        });
      }
      for (var target=0;target<added[loop].length;target++) {
        for (var kid=0;kid<added[loop][target].length;kid++) {
          var rect = drawRect(loop,target,kid);
          var index = ""+loop+"_"+target+"_"+kid;
          allTheRects[index] = rect;
          justAddedRects.push(rect);
        }
      }
      setTimeout(resetSubs,delay,loop+1,Math.max(30,delay*0.96));
      //setTimeout(resetSubs,delay,loop+1,Math.max(30,delay*0.96));
      //setTimeout(drawSubs,delay,loop+1,Math.max(300,delay*0.98));
      //setTimeout(drawSubs,delay,loop+1,1000);
    }


    function drawRect(l,t,c,color) {
      if (l >= added.length) return;
      var sub = added[l][t][c];
      //var color = HSVtoRGB(colors[t],0.5,0.6);
      var color = HSVtoRGB(getColorHue(t),1*getColorSat(t),getColorValue(t));
      var rect = new google.maps.Rectangle({
        map: map,
        // bounds: new google.maps.LatLngBounds(p1,p2),
        bounds: {
          north: Math.max(sub[1],sub[3]),
          south: Math.min(sub[1],sub[3]),
          east:  Math.max(sub[0],sub[2]),
          west:  Math.min(sub[0],sub[2]),
        },
        strokeColor: color,
        strokeOpacity: 1,
        strokeWeight: 1,
        fillColor: color,
        //fillOpacity: 0.6,
        fillOpacity: 0.1,
        visible: true,
        draggable: false,
        clickable: false,
        editable: false,
        zIndex: z++,
      });
      return rect;
    }

    google.maps.event.addDomListener(window, 'load', initialize);
